import React, { useState } from "react";
import dash from "./img/dash.svg";
import "./SideNavbar.css";
import bank from "./img/bank-building@2x 1.svg";
import wallet from './img/wallet.svg'
import exchange from './img/exchange.svg'
import learn from './img/learn.svg'
import blog from './img/blog.svg'
import profile from './img/profile.svg'
import setting from './img/setting.svg'
import logout from './img/logout.png'

const SideNavbar = () => {
  const [isExpended, setExpendedState] = useState(false);

  const menuItems = [
    {
        text: 'Dashboard',
        icon: "./img/dash.svg",
    },
    {
        text: 'Wallet',
        icon: './img/wallet.svg',
    },
    {
        text: 'Exchange Rate',
        icon: 'exchange',
    },
    {
        text: 'Learn',
        icon: 'learn',
    },
    {
        text: 'Blog',
        icon: 'blog',
    },
    {
        text: 'Profile',
        icon: 'profile',
    },
    {
        text: 'Settings',
        icon: 'settings',
    },
    {
        text: 'Logout',
        icon: 'logout',
    }
]

const trad = [
    {
        first: 'demi',
        last: 'lade'
    },
    {
        first: 'timi',
        last: 'lehin'
    }
]
console.log(menuItems);
  return (

    <div
      className={
        isExpended
          ? "side-nav-container"
          : "side-nav-container side-nav-container-NX"
      }
    >
      <div className="nav-upper">
        <div className="nav-heading">
          {isExpended && (
            <div className="nav-brand">
              <img src={bank} alt="" />
              <h2>TradExpress</h2>
            </div>
          )}
          <button
            className={
              isExpended ? "hamburger hamburger-in" : "hamburger hamburger-out"
            }
            onClick={() => setExpendedState(!isExpended)}
          >
            <span></span>
            <span></span>
            <span></span>
          </button>
        </div>
        <div className="nav-menu"> 
        <div className="side">
           <a href="#" className="menu-items">
           <img src={dash} alt="" />
            <p className="menu-item">Dashboard</p>
           </a>
           </div>
           <div className="side">
           <a href="#" className="menu-items">
           <img src={wallet} alt="" />
            <p className="menu-item">Wallet</p>
           </a>
           </div>
           <div className="side">
           <a href="#" className="menu-items">
           <img src={exchange} alt="" />
            <p className="menu-item">Dashboard</p>
           </a>
           </div>
           <div className="side">
            <img src={learn} alt="" />
            <p className="menu-item">Learn</p>
           </div>
           <div className="side">
            <img src={blog} alt="" />
            <p className="menu-item">Blog</p>
           </div>
           <div className="side">
            <img src={profile} alt="" />
            <p className="menu-item">Profile</p>
           </div>
           <div className="side">
            <img src={setting} alt="" />
            <p className="menu-item">Settings</p>
           </div>
           <div className="side">
            <img src={logout} alt="" />
            <p className="menu-item">Logout</p>
           </div>
        </div>

      </div>
    </div>


  );
};

export default SideNavbar;
